mapper.insert:

insert into t_testcase_ui_new (`name`, project_id, timout_time, 
  fail_continue, params, case_vars, 
  case_type, remark, create_by, 
  update_by, create_time, update_time
  )
values (#{name,jdbcType=VARCHAR}, #{projectId,jdbcType=INTEGER}, #{timoutTime,jdbcType=INTEGER}, 
  #{failContinue,jdbcType=INTEGER}, #{params,jdbcType=LONGVARCHAR}, #{caseVars,jdbcType=LONGVARCHAR}, 
  #{caseType,jdbcType=BIGINT}, #{remark,jdbcType=LONGVARCHAR}, #{createBy,jdbcType=VARCHAR}, 
  #{updateBy,jdbcType=VARCHAR}, #{createTime,jdbcType=TIMESTAMP}, #{updateTime,jdbcType=TIMESTAMP}
  )

mapper.select:
select

from t_testcase_ui_new
where 1=1

    and id=#{id,jdbcType=BIGINT}


    and `name`like concat('%', #{name,jdbcType=VARCHAR}, '%')


    and project_id=#{projectId,jdbcType=BIGINT}


    and timout_time=#{timoutTime,jdbcType=BIGINT}


    and fail_continue=#{failContinue,jdbcType=INTEGER}


    and params=#{params,jdbcType=LONGVARCHAR}


    and case_type=#{caseType,jdbcType=BIGINT}


    and remark=#{remark,jdbcType=LONGVARCHAR}


    and create_by=#{createBy,jdbcType=VARCHAR}


    and update_by=#{updateBy,jdbcType=VARCHAR}


    and create_time=#{createTime,jdbcType=TIMESTAMP}


    and update_time=#{updateTime,jdbcType=TIMESTAMP}

select

from t_testcase_ui_new
where `name`=#{name,jdbcType=VARCHAR} and project_id=#{projectId,jdbcType=BIGINT}

select

from t_testcase_ui_new
where case_type=#{caseType,jdbcType=BIGINT} and project_id=#{projectId,jdbcType=INTEGER}
